INSERT INTO `wp_library` (`ID`, `name`, `desc`, `order`, `image`, `custom`, `active`, `terms_manager`, `terms_staff`, `price`, `tag`)
VALUES
	('<library_id_maplewood>', 'Maplewoodshop', 'The <b>Maplewoodshop</b> video library provides self-paced, online instruction in woodworking safety and projects that helps young people learn math, science, design, and even social studies. When kids apply these concepts with their hands, they can apply them again in real world situations.', 10, '<logo.jpg>', 0, 1, 'Terms of Use (Manager / Director / Owner)\n<ul class=\"\\&quot;terms\\&quot;\" style=\"list-style-type: none;\">\n<li><strong>Our Copyright</strong> <br /> I understand that I am purchasing a license to use copyrighted works (a library of video training modules, online quizzes, and related print materials) owned by CampSpirit, LLC, and Target Directories Corporation. This license allows only the use described below as respects the works. These works are intended for educational use only. Any commercial use by me or my organization, such as charging a fee to someone in exchange for viewing these modules or uploading the videos to any website, is strictly forbidden.</li>\n&nbsp;&nbsp;\n<li><strong>Your Use of Content</strong><br />I understand that, pursuant to the license, the works may be read or viewed only by me and my employees or volunteers. No other use is permitted. During the year of subscription, the works may be viewed an unlimited number of times by me and by each such employee or volunteer. However, no copies of any kind (other than those required for such viewing on desktops, laptops, portable media players, or other similar devices of mine or those of my employees or volunteers) of any video training modules or quizzes may be made by me or by any of my employees or volunteers. During the year of subscription, I may duplicate paper copies of print materials (e.g., handouts) for educational use by my employees of volunteers and for no other purpose. Handouts may be included in staff training manuals during the year of subscription.</li>\n&nbsp;&nbsp;\n<li><strong>Subscription Expiration</strong><br />I understand that my license to use to these works (video training modules, online quizzes, and print materials) and my legal right to view them expires on December 31st of the year of purchase. If I or my employees or volunteers wish to continue viewing the modules, quizzes, or print materials, or have access to the updated online library, I must renew my subscription to the library on or after January 1st of the subsequent year.</li>\n&nbsp;&nbsp;\n<li><strong>Misuse of Content</strong><br />I agree to advise my employees and volunteers that these video training modules are intended for their educational use only and that other use, sale, or distribution is strictly forbidden. If I become aware of an employee or volunteer who may have violated these terms, (e.g., posting a module on a personal website or a commercial site such as YouTube) then I agree: (a) to immediately direct that employee or volunteer to summarily remove the module; and (b) to immediately notify Target Directories and CampSpirit of that wrongful conduct along with the name and address of that employee or volunteer. I understand that this material is copyrighted and that copyright infringements may be prosecuted to the full extent of the law.</li>\n&nbsp;&nbsp;\n<li><strong>Relation to Standards</strong><br />I understand that although these modules cover material outlined in certain accreditation standards, such as those provided by the American Camp Association or the Ontario Camp Association, viewing these modules does not constitute compliance with any particular standard. I understand that these modules, and the quizzes, handouts, and discussion questions that accompany them, are intended to help camps meet their educational goals and that it is a camp director&rsquo;s sole responsibility to ensure compliance with any and all applicable laws and standards.</li>\n&nbsp;&nbsp;\n<li><strong>Education Not Treatment</strong><br />I understand that although the content of some video training modules may discuss abnormal or problematic thoughts, behaviors, and emotions, as well as some forms of psychopathology, there is no expressed or implied psychotherapeutic or other treatment relationship between my camp and its employees, volunteers, and patrons / campers and the owners, employees, and volunteers of Target Directories Corporation and CampSpirit, LLC. These relationships are best described as educational. I understand that medical or psychological questions I may have about my employees, volunteers, or patrons / campers are best answered in consultation with a licensed health care professional.</li>\n&nbsp;&nbsp;\n<li>I understand that although the content of some video training modules may discuss abnormal or problematic thoughts, behaviors, and emotions, as well as some forms of psychopathology, there is no expressed or implied psychotherapeutic or other treatment relationship between my camp and its employees, volunteers, and patrons / campers and the owners, employees, and volunteers of Target Directories Corporation and CampSpirit, LLC. These relationships are best described as educational. I understand that medical or psychological questions I may have about my employees, volunteers, or patrons / campers are best answered in consultation with a licensed health care professional.</li>\n&nbsp;&nbsp;\n<li><strong>Disclaimer </strong><br />IAlthough the video training modules and associated print materials are designed to maximize the resources and well-being of an organization&rsquo;s employees, volunteers, and patrons / campers, neither Target Directories Inc. nor CampSpirit, LLC is a guarantor of results. Neither Target Directories Inc. nor CampSpirit, LLC, or any of its owners, employees, or volunteers, may be held liable for any camper&rsquo;s or staff member&rsquo;s illnesses, injuries, accidents, mental health problems, behavior problems, or lapses in judgment that may occur during or after viewing these video training modules and associated quizzes and print materials.</li>\n&nbsp;&nbsp;\n<li><strong>Your Preview Responsibilities </strong><br />I understand that it is my responsibility to preview all of these works (e.g., video training modules, quizzes, and handouts) in order to familiarize myself with the content. In places where my organization&rsquo;s policies or procedures differ in important ways from what is recommended in the works, I understand that it is my responsibility to educate my employees and volunteers about these differences and instruct them in my organization&rsquo;s policies and procedures.</li>\n&nbsp;&nbsp;\n<li><strong>Our Satisfaction Guarantee </strong><br />Our team is so confident that you&rsquo;ll love training your staff with EOT that we guarantee your satisfaction. If you have any questions or need customer support after activating your subscription, simply contact our team toll-free (877) 237-3931, M-F during the hours of 9am to 5pm EST. We promise to do everything we can to answer your questions and get you up and running. We will also help you strategize the best ways to get the most out of your subscription.</li>\n<li><strong>Non-Refundable Activation</strong><br />Because activating your subscription instantly gives you full access to our digital content, we cannot refund your subscription fee after activation. However, we are happy to roll over any unused staff accounts when you renew your subscription. For example, if you purchased 100 staff accounts in 2014 but used only 95 staff accounts, we will credit your 2015 account with 5 staff accounts. Note that unused staff accounts can only be rolled over to your own EOT subscription and only when you renew for the following year. Unused staff accounts are not transferable to other organizations.</li>\n&nbsp;&nbsp;</ul>\n<ul class=\"\\&quot;terms\\&quot;\" style=\"list-style-type: none;\">\n<li><strong>Terms of Use (Individual Learner / Student / Parent)</strong></li>\n<li><strong>Non-Refundable Activation</strong><br />Because activating your subscription instantly gives you full access to our digital content, we cannot refund your subscription fee after activation. However, we are happy to roll over any unused staff accounts when you renew your subscription. For example, if you purchased 100 staff accounts in 2014 but used only 95 staff accounts, we will credit your 2015 account with 5 staff accounts. Note that unused staff accounts can only be rolled over to your own EOT subscription and only when you renew for the following year. Unused staff accounts are not transferable to other organizations.</li>\n&nbsp;&nbsp;\n<li><strong>Non-Refundable Activation</strong><br />Because activating your subscription instantly gives you full access to our digital content, we cannot refund your subscription fee after activation. However, we are happy to roll over any unused staff accounts when you renew your subscription. For example, if you purchased 100 staff accounts in 2014 but used only 95 staff accounts, we will credit your 2015 account with 5 staff accounts. Note that unused staff accounts can only be rolled over to your own EOT subscription and only when you renew for the following year. Unused staff accounts are not transferable to other organizations.</li>\n&nbsp;&nbsp;\n<li><strong>Non-Refundable Activation</strong><br />Because activating your subscription instantly gives you full access to our digital content, we cannot refund your subscription fee after activation. However, we are happy to roll over any unused staff accounts when you renew your subscription. For example, if you purchased 100 staff accounts in 2014 but used only 95 staff accounts, we will credit your 2015 account with 5 staff accounts. Note that unused staff accounts can only be rolled over to your own EOT subscription and only when you renew for the following year. Unused staff accounts are not transferable to other organizations.</li>\n</ul>', 'By clicking \"I ACCEPT\" below, I agree to the following:\n\n<li><strong>Privacy Policy</strong> <br /> Thank you for visiting our website. The team at Expert Online Training respects your right to privacy. The purpose of this website privacy policy is to outline how we deal with any personal data you provide to us while visiting this website. Naturally, if you are not happy with our website privacy policy then you should not use this website.</li>\n\n<li>By visiting this website, you are accepting the terms of this website privacy policy. Any external links to other websites are clearly identifiable as such, and we are not responsible for the content or the privacy policies of these websites.</li>\n\n<li>These practices may be changed, but any changes will be posted and changes will only apply to activities and information on a going forward, not retroactive basis. You are encouraged to review our website privacy policy whenever you visit the site to make sure that you understand how any personal information you provide will be used. </li>\n\n<li><strong>Types of Information Collected and How We Use It</strong> <br /> We retain two types of information: Personal Data and Non-personal Data. How we use those data is described in the next two paragraphs.</li>\n\n<li>Personal Data&mdash;This is data that identifies you or can be used to identify or contact you and may include your (e.g. name, address, telephone number, email address, user IP addresses in circumstances where they have not been deleted, clipped or made anonymous, telephone number, birth date and billing and credit card information). When you subscribe to content on Expert Online Training, we ask for information such as your name, email, address and telephone number. The team at Expert Online Training uses collected information for the following general purposes: products and services provision, billing, identification and authentication, services improvement, contact and research.</li>\n\n<li>Non-Personal Data&mdash;Like most websites, we gather statistical and other analytical information collected on an aggregate basis of all visitors to our website. This Non-Personal Data is comprised of information that cannot be used to identify or contact you (e.g., demographic information regarding user IP addresses where they have been clipped or made anonymous, browser types and other anonymous statistical data involving the use of our website).</li>\n\n<li>If, at some point in the future, you would like your data to be removed from our systems, please send an email to info@ExpertOnlineTraining.com with the word &ldquo;REMOVE&rdquo; as the subject line. In the body of the email, state your request to have your personal and/or non-personal data removed. Please also provide the first name, last name, and email address(es) that you or your employer provided to Expert Online Training. We will remove your data within 15 business days.</li>\n\n<li><strong>Cookie and Tracking Technologies</strong><br />Expert Online Training may use cookie and tracking technologies depending on the features offered. Cookie and tracking technologies are useful for gathering information such as logging users&rsquo; browser type and operating system, tracking the number of visitors to the site, and understanding how visitors use the site.</li>\n\n<li>Cookies can also help customize the site for visitors. Personal information cannot be collected via cookies and other tracking technologies. However, if you previously provided personally identifiable information, cookies may be tied to such information. Aggregate cookie and tracking information may be shared with third parties after these third parties have signed a confidentiality agreement approved by the Expert Online Training team.</li>\n\n<li><strong>Distribution of Information</strong>The information we collect is used to improve the content of our web pages and the quality of our service, and is not shared with or sold to other organizations for commercial purposes, except to provide products or services you&rsquo;ve requested, when we have your permission.</li>\n\n<li>We may share information with governmental agencies or other companies assisting us in fraud prevention or investigation. We may do so when we are permitted or required by law, or when trying to protect against or prevent actual or potential fraud or unauthorized transactions, when investigating fraud which has already taken place.</li>\n\n<li><strong>Commitment to Data Security </strong><br />Your personally identifiable information is kept secure. Only authorized employees, agents and contractors (who have agreed in writing to keep information secure and confidential) have access to this information. The Expert Online Training team uses third party vendors and hosting partners to provide the necessary hardware, software, networking, storage, and related technology required to run. Although the Expert Online Training team owns the code, databases and all rights to the application, you retain all rights to your data. You may ask us to share back with you the personal data you have given us. You may also ask us to delete your personal data from our files.</li>\n<li>Although Expert Online Training has implemented strict security policies, rules, procedures and technical measures to protect your personal data, we cannot guarantee the security of the data that you transmit through the website, and any transmission is at your own risk and the companies and employees which run Expert Online Training (including but not limited to its creators, CampSpirit, LLC and Target Directories Corporation) will not be held liable for adverse consequences that result from such a security breach.</li>\n<li><strong>Sale of Business</strong><br />We reserve the right to transfer information (including your personal data) to a third party in the event of a sale, merger, liquidation, receivership or transfer of all or substantially all of the assets of our company provided that the third party agrees to adhere to the terms of the website privacy policy and provided that the third party only uses your Personal Data for the purposes that you provided it to us. You will be notified in the event of any such transfer and you will be afforded an opportunity to opt-out.</li>\n<li><strong>Changes to the Website Privacy Policy</strong><br />Any changes to this website privacy policy will be posted on this website so you are always aware of what information we collect, how we use it, and under what circumstances, if any, we disclose it. If at any time we decide to use personal data in a manner significantly different from that stated in this website privacy policy, or otherwise disclosed to you at the time it was collected, we will notify you by email. You will have a choice as to whether or not we use your information in the new manner.</li>\n<li><strong>Your Rights</strong><br />In accordance with our duties as data controllers we aim to process data fairly. As mentioned above, we are committed to keeping secure all personal data we collect. If you wish to find out what personal data Expert Online Training holds on you, you can email our Compliance Manager at info@ExpertOnlineTraining.com. We will respond to this data access request as soon as possible and no longer than a reasonable amount of time.</li>\n<li><strong>Contact Us</strong><br />If you have any other questions relating to privacy or data protection, please contact us by email at info@ExpertOnlineTraining.com.</li>\n<li><strong>Thank You</strong><br />We thank you for visiting our website and for your careful reading of this website privacy policy.</li>\n', 0.00, 'MWS\n');
