INSERT INTO `wp_video` (`ID`, `module_id`, `presenter_id`, `name`, `subtitle`, `desc`, `video_name`, `shortname`, `shortname_medium`, `shortname_low`, `spanish`, `image`, `thumbnail`, `order`, `new`, `active`, `sample`, `standards_aca`, `standards_oca`, `standards_sca`, `standards_cans`, `standards_acq`, `standards_nbca`, `standards_bcca`, `standards_mca`, `standards_alberta`, `secs`, `next_id`, `year`, `difficulty`, `ns`, `rs`, `ps`, `ss`, `director`, `width`, `medium_width`, `low_width`, `height`, `medium_height`, `low_height`, `hd`)
VALUES
	(189,<module_id_mws_footstool>,0,'Advanced - Make a Footstool', 'Make a sturdy and elegant footstool!', 'For advanced woodworkers. In this project, your woodworkers will make a real piece of furniture. The footstool project teaches how screws and a dowel can make a strong leg assembly. This project lends itself very well to decorative edges using the block plane. Woodworkers should do the Jenga Blocks and Keepsake box or Tooltote before doing this project.', 'mws_footstool', 'mws_footstool-high', 'mws_footstool-medium', 'mws_footstool-low', NULL, 'mws_footstool.jpg', 'mws_footstool_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1726, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(191,<module_id_mws_tooltote>,0,'Advanced - Make a Tooltote', 'Make a custom and functional tool tote!', 'For advanced woodworkers - Make a custom tooltote! This variation of the tooltote project uses three equal length pieces of wood which means that your woodworkers get to rip one piece along its length and then plane it to size. Very engaging project and should be done after Jenga Blocks.\n', 'mws_tooltote', 'mws_tooltote-high', 'mws_tooltote-medium', 'mws_tooltote-low', NULL, 'mws_tooltote.jpg', 'mws_tooltote_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2358, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(192,<module_id_mws_keepsakebox>,0,'Basic - Make a Keepsake Box', 'Make a simple box from a single plank of wood!', 'For basic woodworkers. Make your own keepsake box from a single plank of wood! This project can be combined with a short Jenga blocks project so that woodworkers learn how to use the saw. \n', 'mws_keepsakebox', 'mws_keepsakebox-high', 'mws_keepsakebox-medium', 'mws_keepsakebox-low', NULL, 'mws_keepsakebox.jpg', 'mws_keepsakebox_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 973, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(194,<module_id_mws_jengablocks>,0,'Basic - Make Jenga Blocks', 'Learn to saw while making toys!', 'This starter project allows woodworkers to learn how to use the pull saw. They end up with a series of one inch wide blocks that can be made into other sculptures or used in future projects.', 'mws_jengablocks', 'mws_jengablocks-high', 'mws_jengablocks-medium', 'mws_jengablocks-low', NULL, 'mws_jengablocks.jpg', 'mws_jengablocks_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 258, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(195,<module_id_mws_jigsawpuzzles>,0,'Basic - Make Jigsaw Puzzles', 'Learn the coping saw while making toys!', 'This starter project allows woodworkers to learn how to use the coping saw. They can design puzzles on two sides of a board then cut a random or patterned shape. \n', 'mws_jigsawpuzzles', 'mws_jigsawpuzzles-high', 'mws_jigsawpuzzles-medium', 'mws_jigsawpuzzles-low', NULL, 'mws_jigsawpuzzles.jpg', 'mws_jigsawpuzzles_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 110, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(197,<module_id_mws_blockplane>,0,'How to use a Block Plane', 'Learn to use a small but powerful tool!', 'The block plane is very effective at smoothing and shaping wood. You can use it to square up boards, flatten edges, and create lovely profiles. In this video learn how to do each of these operations as well as how to maintain this tool. ', 'mws_blockplane', 'mws_blockplane-high', 'mws_blockplane-medium', 'mws_blockplane-low', NULL, 'mws_blockplane.jpg', 'mws_blockplane_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 678, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(198,<module_id_mws_pullsaw>,0,'How to use a Pull Saw', 'Learn to saw with one hand or two!', 'The pull saw is easy to learn and can make fast work of sawing wood. In this video, you will learn proper stance for both one handed and two handed sawing. Remember, pull, reset and repeat!', 'mws_pullsaw', 'mws_pullsaw-high', 'mws_pullsaw-medium', 'mws_pullsaw-low', NULL, 'mws_pullsaw.jpg', 'mws_pullsaw_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 675, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(199,<module_id_mws_cutoutcar>,0,'Intermediate - Make a Cut-Out Car', 'Learn to make a toy from scratch!', 'For intermediate woodworkers. Make your own toy! This project allows woodworkers to design and cut out their own car. Wheels are cut from a 2\" dowel and joined with a wood dowel for an axle.', 'mws_cutoutcar', 'mws_cutoutcar-high', 'mws_cutoutcar-medium', 'mws_cutoutcar-low', NULL, 'mws_cutoutcar.jpg', 'mws_cutoutcar_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1074, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(201,<module_id_mws_intermediatetooltote>,0,'Intermediate - Make a Tooltote', 'Learn to make your own roomy tool tote!', 'For intermediate woodworkers. Make your large tool tote. This project is conceptually similar to the keepsake box but adds a handle and the opportunity to create your own profile on the ends. Very good for teaching order of operations and one of most popular projects.', 'mws_intermediatetooltote', 'mws_intermediatetooltote-high', 'mws_intermediatetooltote-medium', 'mws_intermediatetooltote-low', NULL, 'mws_intermediatetooltote.jpg', 'mws_intermediatetooltote_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1780, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(203,<module_id_mws_safeprog>,0,'Leading Safe Programs', 'Learn to lead safe woodworking programs!', 'Safety is up to you, the instructor. In this video you will learn the five rules of Maplewoodshop and how to maintain a safe environment in your class.', 'mws_safeprog', 'mws_safeprog-high', 'mws_safeprog-medium', 'mws_safeprog-low', NULL, 'mws_safeprog.jpg', 'mws_safeprog_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 464, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(204,<module_id_mws_roomsetupsafety>,0,'Room setup and safety', 'Learn how to set up and manage your portable woodshop!', 'A safe room enables safe woodworking. In this video learn how to set up your tables, walk with tools, label projects and manage dozens of woodworkers per day.', 'mws_roomsetupsafety', 'mws_roomsetupsafety-high', 'mws_roomsetupsafety-medium', 'mws_roomsetupsafety-low', NULL, 'mws_roomsetupsafety.jpg', 'mws_roomsetupsafety_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 143, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(205,<module_id_mws_designchallenge>,0,'Advanced - Make a design Challenge', 'Challenge your advanced woodworkers to make their own creations!', 'For advanced woodworkers. Once you have worked through each of the projects, your woodworkers are ready to try their own ideas. In this video, learn how to develop a design challenge for your advanced woodworkers.', 'mws_designchallenge', 'mws_designchallenge-high', 'mws_designchallenge-medium', 'mws_designchallenge-low', NULL, 'mws_designchallenge.jpg', 'mws_designchallenge_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 34, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(206,<module_id_mws_stringart>,0,'Basic - Make String Art', 'Learn the hammer while making keepsakes!', 'This starter project allows woodworkers to learn how to use a hammer. They can use templates or design thier own creations. ', 'mws_stringart', 'mws_stringart-high', 'mws_stringart-medium', 'mws_stringart-low', NULL, 'mws_stringart.jpg', 'mws_stringart_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 140, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(208,<module_id_mws_safetyvalves>,0,'Creating Safety Valves', 'Help your woodworkers get out frustration!', 'Woodworking can be tough and tools can be tempting. In this video, learn how a hammering log can provide an outlet for frustratated or distracted woodworkers as well as provide an activity in between classes.', 'mws_safetyvalves', 'mws_safetyvalves-high', 'mws_safetyvalves-medium', 'mws_safetyvalves-low', NULL, 'mws_safetyvalves.jpg', 'mws_safetyvalves_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 55, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(209,<module_id_mws_dustprotection>,0,'Eye Ear and Dust Protection', 'Keep your woodworkers eyes, ears, and lungs safe!', 'While hand tool woodworking is safer than using power tools, you do need to consider when to use eye and ear protection. In this video, learn how to prevent eye, hearing, and breathing injuries.', 'mws_dustprotection', 'mws_dustprotection-high', 'mws_dustprotection-medium', 'mws_dustprotection-low', NULL, 'mws_dustprotection.jpg', 'mws_dustprotection_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 34, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(210,<module_id_mws_usebracedrill>,0,'How to use a Bit Brace Drill', 'Learn to use a large drill!', 'The bit brace drill is a powerful and effective tool for making medium and large holes. It is an elegant example of how a lever and a screw (simple machines) can be combined to make a powerful tool. In this video learn how to set up your drilling station, how to drill, how to remove chips that may jam your drill, and how to change bits.', 'mws_usebracedrill', 'mws_usebracedrill-high', 'mws_usebracedrill-medium', 'mws_usebracedrill-low', NULL, 'mws_usebracedrill.jpg', 'mws_usebracedrill_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 325, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(212,<module_id_mws_combsquare>,0,'How to use a Combination Square', 'Learn to make square cuts and more!', 'The combination square is useful for making perpindicular and diagonal lines. It has a level and a scratch awl as well. In this video learn how to use each feature and how to \'repair\' when the ruler comes out of the body.', 'mws_combsquare', 'mws_combsquare-high', 'mws_combsquare-medium', 'mws_combsquare-low', NULL, 'mws_combsquare.jpg', 'mws_combsquare_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 287, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(214,<module_id_mws_compass>,0,'How to use a Compass', 'Learn to use this ancient tool!', 'The compass helps you draw circles and even find midpoints of lines! In this video we will explore this ancient and powerful tool.', 'mws_compass', 'mws_compass-high', 'mws_compass-medium', 'mws_compass-low', NULL, 'mws_compass.jpg', 'mws_compass_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 430, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(215,<module_id_mws_copingsaw>,0,'How to use a Coping Saw', 'Learn to make curves in your projects!', 'The coping saw allows you to cut curves and add creativity to your projects. It takes a while to learn but is worth the effort. In this video you will learn how to use and maintain the coping saw.', 'mws_copingsaw', 'mws_copingsaw-high', 'mws_copingsaw-medium', 'mws_copingsaw-low', NULL, 'mws_copingsaw.jpg', 'mws_copingsaw_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 224, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(216,<module_id_mws_copingsawadvanced>,0,'How to use a Coping Saw - Advanced Features', 'Learn advanced techniques using a coping saw!', 'The coping saw can do more than curves. You can create blind curves and rotate the handle to get more access when needed. Watch this video to unlock advanced techniques.', 'mws_copingsawadvanced', 'mws_copingsawadvanced-high', 'mws_copingsawadvanced-medium', 'mws_copingsawadvanced-low', NULL, 'mws_copingsawadvanced.jpg', 'mws_copingsawadvanced_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 240, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(217,<module_id_mws_usehammer>,0,'How to use a Hammer', 'Learn to hammer without hitting your thumb!', 'Tap, tap, Bang goes our saying to avoid hitting your thumb. In this video, learn how to effectively use a hammer.', 'mws_usehammer', 'mws_usehammer-high', 'mws_usehammer-medium', 'mws_usehammer-low', NULL, 'mws_usehammer.jpg', 'mws_usehammer_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 143, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(218,<module_id_mws_userasp>,0,'How to use a Rasp', 'Learn to shape wood with this handy tool!', 'The rasp is effective at removing material to shape wood. In this video you will learn how to pull the rasp to success working with the grain of your project.', 'mws_userasp', 'mws_userasp-high', 'mws_userasp-medium', 'mws_userasp-low', NULL, 'mws_userasp.jpg', 'mws_userasp_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 116, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(219,<module_id_mws_screwdriver>,0,'How to use a Screwdriver', 'Learn to connect wood with screws!', 'The screwdriver is a hard tool to learn for young woodworkers. In this video, you will learn how to use one hand to drive and one hand to steer the screwdriver and make it easy to learn.', 'mws_screwdriver', 'mws_screwdriver-high', 'mws_screwdriver-medium', 'mws_screwdriver-low', NULL, 'mws_screwdriver.jpg', 'mws_screwdriver_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 170, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(221,<module_id_mws_tapemeasure>,0,'How to use a Tape Measure', 'Learn to measure accurately!', 'The tape measure can teach us a lot about fractions, find distances, and even find the midpoint of a board. In this video, learn techniques to make the most of this tool.', 'mws_tapemeasure', 'mws_tapemeasure-high', 'mws_tapemeasure-medium', 'mws_tapemeasure-low', NULL, 'mws_tapemeasure.jpg', 'mws_tapemeasure_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 55, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(222,<module_id_mws_eggbeaterdrill>,0,'How to use an Eggbeater Drill', 'Learn to make small holes effeciently!', 'The eggbeater drill works well when you spin it fast. In this video, learn how to drill without jamming and what do to when you do jam.', 'mws_eggbeaterdrill', 'mws_eggbeaterdrill-high', 'mws_eggbeaterdrill-medium', 'mws_eggbeaterdrill-low', NULL, 'mws_eggbeaterdrill.jpg', 'mws_eggbeaterdrill_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 150, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(223,<module_id_mws_fclamps>,0,'How to use F Clamps', 'Learn to secure your wood!', 'There is a saying that you can never have too many clamps. In this video you will learn how to use these effective clamps to prevent blow out when drilling and how to use them for a variety of tasks.', 'mws_fclamps', 'mws_fclamps-high', 'mws_fclamps-medium', 'mws_fclamps-low', NULL, 'mws_fclamps.jpg', 'mws_fclamps_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 82, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(226,<module_id_mws_sandpaper>,0,'How to use Sandpaper', 'Learn to smooth your projects!', 'Sandpaper can make a project feel truly finished. In this video you will learn the difference between grits and how to use sandpaper effectively.', ' mws_sandpaper', ' mws_sandpaper-high', ' mws_sandpaper-medium', ' mws_sandpaper-low', NULL, ' mws_sandpaper.jpg', ' mws_sandpaper_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 122, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(227,<module_id_mws_sectoranddivider>,0,'How to use Sector and Divider', 'Learn these ancient and very effective tools!', 'The sector and divider have been around for thousands of years. In this video you will learn how to scale projects up and down using simple, whole number fractions.', ' mws_sectoranddivider', ' mws_sectoranddivider-high', ' mws_sectoranddivider-medium', ' mws_sectoranddivider-low', NULL, ' mws_sectoranddivider.jpg', ' mws_sectoranddivider_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 213, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(228,<module_id_mws_scrapatecture>,0,'Intermediate - Make Scrapatecture', 'Learn to make projects from the scrap bin!', 'For intermediate woodworkers. Once woodworkers have learned tools via other projects, they also have created a decent cache of scrap wood. In this project, encourage free form creativity while they make what they want from your scrap bin.', ' mws_scrapatecture', ' mws_scrapatecture-high', ' mws_scrapatecture-medium', ' mws_scrapatecture-low', NULL, ' mws_scrapatecture.jpg', ' mws_scrapatecture_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 67, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(229,<module_id_mws_stringart>,0,'Intermediate - Variations on String Art', 'Learn to make sophisticated projects using hammers, nails and string!', 'For intermediate woodworkers. Once woodworkers have learned how to hammer, you can introduce a wide range of much more complex string art. You can even make very large scale mosaics as legacy projects.', ' mws_stringart', ' mws_stringart-high', ' mws_stringart-medium', ' mws_stringart-low', NULL, ' mws_stringart.jpg', ' mws_stringart_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 56, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(231,<module_id_mws_toolbox>,0,'The Toolbox', 'Learn the features of the Maplewoodshop toolbox!', 'The Maplewoodshop toolbox has everything you need to offer hand tool woodworking. In this video, get to know the features of the toolbox and even how to transport it if you have mulitple locations.', 'mws_toolbox', 'mws_toolbox-high', 'mws_toolbox-medium', 'mws_toolbox-low', NULL, 'mws_toolbox.jpg', 'mws_toolbox_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 74, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(232,<module_id_mws_welcomemws>,0,'Welcome to Maplewoodshop!', 'Start here. We are glad you are here! ', 'Welcome! We are so happy you are here and look forward to sharing information on safety, tools, and projects you can offer your budding woodworkers!', 'mws_welcomemws', 'mws_welcomemws-high', 'mws_welcomemws-medium', 'mws_welcomemws-low', NULL, 'mws_welcomemws.jpg', 'mws_welcomemws_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 30, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(233,<module_id_mws_pullsaws>,0,'Why we use Pull Saws', 'Learn why we use these Japanese saws!', 'Some people ask why we use pull saws. In this video learn why and also how it relates to photosynthesis! An interesting connection to be sure.', 'mws_pullsaws', 'mws_pullsaws-high', 'mws_pullsaws-medium', 'mws_pullsaws-low', NULL, 'mws_pullsaws.jpg', 'mws_pullsaws_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 172, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1),
	(235,<module_id_mws_core>,0,'Work with your Core', 'Learn how to make woodworking easier!', 'Woodworking, like a sport, is most fun when done right. In this video, you will learn the body mechanics of using hand tools to help your woodworkers get the most from their experiences.', 'mws_core', 'mws_core-high', 'mws_core-medium', 'mws_core-low', NULL, 'mws_core.jpg', 'mws_core_thumb.png', 50.00, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 100, NULL, 2018, 0, 0, 0, 0, 0, 0, 640, 640, 640, 360, 360, 360, 1);
